import React from 'react';
import { MDBContainer, MDBBtn, MDBModal, MDBModalBody, MDBModalHeader, MDBModalFooter } from 'mdbreact';



export class Popup extends React.Component{
  constructor(props){
    super(props);
  }
  // handleClose(){
  //   this.props.handleClose();
  // }
  render(){
    return(
      <div classname="popup-main">
      <MDBContainer>
        <MDBModal isOpen={this.props.show} toggle={()=>this.props.handleToggle()} size="fluid">
          <MDBModalHeader toggle={()=>this.props.handleToggle()}>{this.props.member.name}</MDBModalHeader>
          <MDBModalBody>
            {this.props.member.bio}
          </MDBModalBody>
          <MDBModalFooter>
            <MDBBtn color="secondary" onClick={()=>this.props.handleToggle()}>Close</MDBBtn>
          </MDBModalFooter>
        </MDBModal>
      </MDBContainer>
      </div>

    );
  }
}
export default Popup;
